import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrapper:{
        width: "676px",
        marginTop: '100px',
        display: 'flex',
        flexDirection: 'row',
        flexWrap: 'wrap',
        justifyContent: 'center',
        alignItems: 'center',
    },
    img1:{
        marginRight: '58px',
        marginBottom: '58px',
        width: "331px",
        height: "497px"
    },
    img2: {
        width: "287px",
        height: "192px"
    },
    img3:{
        width: "336px",
        height: '224px'
    }
});
export default styles;
